import React from 'react';

const days = ['Dom', 'Lun', 'Mar', 'Mié', 'Jue', 'Vie', 'Sáb'];

/**
 * CalendarHeader Component
 * Renders the header row for the calendar (day names).
 */
const CalendarHeader = () => (
  <div className="calendar-pro-header">
    {days.map(day => (
      <div className="header-pro" key={day}>{day}</div>
    ))}
  </div>
);

export default CalendarHeader;
